import vk from '../../../Images/vk.png';
import got from '../../../Images/got.png';
import ghost from '../../../Images/ghost.png';
import '../../../NewOne/Appp.css';

const HomepageHeading = ({ bool }) => {
  console.log("this is what =" + bool)
  return (
    <Container style={{ width: '100%' }}>
      <Grid.Column
        tablet={3}
        computer={3}
        only="tablet computer"
        id="sidebar"
      >
        <Menu vertical borderless fluid text>
          <Menu.Item active as="a">
            Overview
                </Menu.Item>
          <Menu.Item as="a">Reports</Menu.Item>
          <Menu.Item as="a">Analytics</Menu.Item>
          <Menu.Item as="a">Export</Menu.Item>
          <Divider hidden />
