              SDFDSFSDFSDF<br />
              SFSDF
              SDFDSFSDFSDF<br />
              SFSDF
            </Grid.Column>
            <Grid.Column width={11}> */}
              {/* <img class="ui fluid image" src={got}/> */}
              {/* <Image src={got} /> */}
            {/* </Grid.Column>
          </Grid.Row>
        </Grid>
      </Segment> */}
    </Container>
  )
}

HomepageHeading.propTypes = {
  mobile: PropTypes.bool
}

export default HomepageHeading;
